import '../../styles.css'
import './style.css'
//import 'bootstrap/dist/css/bootstrap.min.css';
import { NavbarBrand, Navbar, NavbarText, Container, Input } from 'reactstrap'
import Nav from '../Navbar'
import Card from '../Card'
import Form from '../Form'

const App = () => {

  return (
    <div className="App">
      <Nav />
      <Form />
      <Card />
    </div>

  );
}

export default App;
